import './App.css';
import Movie from './components/Movies';
import { Routes, Route } from "react-router-dom";
import Error from './components/Error';

function App() {


  return (
    <div className="App">



        <Routes>
          <Route path="/" element={<App />} />
          <Route path="/movie" element={<Movie />} />
          <Route path="*" element={<Erro />} />

        </Routes>



    </div>

  );
}

export default App;
